class Solution {
public:
	vector<vector<bool>> mark;
	void solve(vector<vector<char>>& board) {
		if (board.size() <= 0 || board[0].size() <= 0)
			return;
		//这种方法递归的次数太多，最后在oj上报runtime error的错误
		//可能是递归次数太多了报错
		int m = board.size();
		int n = board[0].size();
		int i, j;
		vector<bool>temp(n,false);
		for (i = 0; i < m; i++)
		{
			mark.push_back(temp);
		}
		bool res;
		for (i = 0; i < m; i++)
		{
			for (j = 0; j < n; j++)
			{
				if (board[i][j] == 'O')
				{
					res = traverse(board,i,j);
					if (res)
					{
						//什么也不用做
					}
					else
					{
						board[i][j] =='X' ;
					}
				}
			}
		}
		//show(board);

	}
	bool traverse(vector<vector<char>>& board,int x,int y)
	{
		if (x < 0 || x >= board.size())
			return true;
		if (y < 0 || y >= board[0].size())
			return true;
		
		if (board[x][y] == 'O')
		{
			bool left, right, up, down;
			board[x][y] = 'X';
			left = traverse(board, x - 1, y);  //left
			board[x][y] = 'O';
			if (left)
				return true;
			board[x][y] = 'X';
			right = traverse(board, x + 1, y);  //right
			board[x][y] = 'O';
			if (right)
				return true;
			board[x][y] = 'X';
			up = traverse(board, x, y - 1);  // up
			board[x][y] = 'O';
			if (up)
				return true;
			board[x][y] = 'X';
			down = traverse(board, x, y + 1);  //down
			board[x][y] = 'O';
			if (down)
				return true;
		}
		return false;
	}
	void show(vector<vector<char>> board)
	{
		int m = board.size();
		int n = board[0].size();
		for (int i = 0; i < m; i++)
		{
			for (int j = 0; j < n; j++)
			{
				cout << board[i][j]<< " ";
			}
			cout << endl;
		}
	}
};

class Solution1 {
public:
	void solve(vector<vector<char>>& board) {
		//这个题目实际上比ex200还简单一些只需要遍历最外层出现O的地方
		//把这些连通就行了
		//你大爷的深度递归死活不让过~~~
		//我就说我上面的解法应该没有问题的
		if (board.size() <= 0 || board[0].size() <= 0)
			return;
		int m = board.size();
		int n = board[0].size();
		int i, j;
		for (i = 0; i < m; i++)
		{
			if (board[i][0] == 'O')
				traverse1(board, i, 0);
			if (board[i][n-1] == 'O')
				traverse1(board, i, n - 1);
		}
		for (j = 0; j < n; j++)
		{
			if (board[0][j] == 'O')
				traverse1(board, 0, j);
			if (board[m-1][j] == 'O')
				traverse1(board, m - 1, j);
		}
		for (i = 0; i < m; i++)
		{
			for (j = 0; j < n; j++)
			{
				if (board[i][j] == 'O')
					board[i][j] = 'X';
				if (board[i][j] == 'E')
					board[i][j] = 'O';
			}
		}
		//show(board);
	}
	void traverse1(vector<vector<char>>& board, int x, int y)
	{
		if (x >= 0 && y >= 0 && x < board.size() && y < board[0].size() && board[x][y] == 'O')
		{
			board[x][y] = 'E';
			traverse1(board, x - 1, y);  //left
			traverse1(board, x + 1, y);  //right
			traverse1(board, x, y - 1);  // up
			traverse1(board, x, y + 1);  //down
		}
	}
	void show(vector<vector<char>> board)
	{
		int m = board.size();
		int n = board[0].size();
		for (int i = 0; i < m; i++)
		{
			for (int j = 0; j < n; j++)
			{
				cout << board[i][j] << " ";
			}
			cout << endl;
		}
	}
};

/*
 *  下面是宽度优先的搜索，就是加了一个队列
 */
class Solution2 {
public:
	void process(int i, int j, vector<vector<char> >& board)
	{
		int m = board.size();
		int n = board[0].size();

		typedef pair<int, int> point;
		queue<point> Q;
		Q.push(point(i, j));
		board[i][j] = 'E';
		while (!Q.empty())
		{
			point tmp = Q.front();
			Q.pop();

			int x = tmp.first, y = tmp.second;
			//横纵坐标

			//extending  这个地方就是不断扩展
			if (x != 0 && board[x - 1][y] == 'O')
			{
				Q.push(point(x - 1, y));
				board[x - 1][y] = 'E';   //extended;
			}
			if (x != m - 1 && board[x + 1][y] == 'O')
			{
				Q.push(point(x + 1, y));
				board[x + 1][y] = 'E';   //extended;
			}
			if (y != 0 && board[x][y - 1] == 'O')
			{
				Q.push(point(x, y - 1));
				board[x][y - 1] = 'E';   //extended;
			}
			if (y != n - 1 && board[x][y + 1] == 'O')
			{
				Q.push(point(x, y + 1));
				board[x][y + 1] = 'E';   //extended;
			}
		}
	}
	void solve(vector<vector<char> >& board)
	{
		int m = board.size();
		if (m == 0)
			return;
		int n = board[0].size();
		int i, j;
		for (i = 0; i<m; i++)
		{
			//处理边框
			if (board[i][0] == 'O')
				process(i, 0, board);
			if (board[i][n - 1] == 'O')
				process(i, n - 1, board);
		}
		for (j = 0; j<n; j++)
		{
			if (board[0][j] == 'O')
				process(0, j, board);
			if (board[m - 1][j] == 'O')
				process(m - 1, j, board);
		}
		for (i = 0; i<m; i++)
			for (j = 0; j<n; j++)
			{
				if (board[i][j] == 'O')
					board[i][j] = 'X';
				else if (board[i][j] == 'E')
					board[i][j] = 'O';
			}
	}
};

